from bs4 import BeautifulSoup
import re
import json


class TwitterHTMLParser:
    """
    Un parser spécialisé pour extraire les données de posts Twitter
    à partir d'un document HTML fourni par l'utilisateur.
    """

    def __init__(self):
        self.soup = None

    def parse_html(self, html_content):
        """
        Parse le contenu HTML et initialise l'objet BeautifulSoup

        Args:
            html_content (str): Le contenu HTML à analyser

        Returns:
            self: Pour permettre le chaînage des méthodes
        """
        self.soup = BeautifulSoup(html_content, 'html.parser')
        return self

    def extract_tweets(self):
        """
        Extrait les tweets du document HTML fourni
        Adapté pour les structures HTML typiques des tweets
        """
        if not self.soup:
            return []

        tweets = []

        # Différentes stratégies de recherche pour s'adapter à différentes structures HTML

        # Stratégie 1: Recherche par article (structure commune pour les tweets)
        tweet_articles = self.soup.find_all('article')
        for article in tweet_articles:
            tweet_data = self._parse_tweet_element(article)
            if tweet_data:
                tweets.append(tweet_data)

        # Stratégie 2: Recherche par div avec attributs spécifiques à Twitter
        tweet_divs = self.soup.find_all('div', {'data-testid': 'tweet'})
        for div in tweet_divs:
            tweet_data = self._parse_tweet_element(div)
            if tweet_data and tweet_data not in tweets:
                tweets.append(tweet_data)

        # Stratégie 3: Recherche par classe (peut varier selon la version de Twitter)
        common_tweet_classes = ['tweet', 'twitter-tweet', 'TwitterCard', 'js-tweet']
        for class_name in common_tweet_classes:
            elements = self.soup.find_all(class_=re.compile(class_name))
            for element in elements:
                tweet_data = self._parse_tweet_element(element)
                if tweet_data and tweet_data not in tweets:
                    tweets.append(tweet_data)

        return tweets

    def _parse_tweet_element(self, element):
        """
        Analyse un élément HTML de tweet et extrait les informations importantes

        Args:
            element: Un élément BeautifulSoup contenant un tweet

        Returns:
            dict: Données structurées du tweet
        """
        tweet_data = {
            'content': '',
            'author': '',
            'username': '',
            'timestamp': '',
            'likes': 0,
            'retweets': 0,
            'replies': 0,
            'hashtags': [],
            'mentions': [],
            'urls': [],
            'images': [],
            'videos': []
        }

        # Extraire le contenu principal du tweet
        content_elements = element.find_all(['p', 'div'], class_=re.compile('text|content'))
        if content_elements:
            tweet_data['content'] = content_elements[0].get_text(strip=True)
        else:
            # Fallback pour trouver le contenu
            content = element.find(attrs={'data-testid': 'tweetText'})
            if content:
                tweet_data['content'] = content.get_text(strip=True)

        # Extraire l'auteur et le nom d'utilisateur
        author_element = element.find(attrs={'data-testid': 'User-Name'}) or element.find(
            class_=re.compile('author|fullname'))
        if author_element:
            tweet_data['author'] = author_element.get_text(strip=True)

        username_element = element.find(class_=re.compile('username|screen-name')) or element.find('span',
                                                                                                   text=re.compile(
                                                                                                       '^@'))
        if username_element:
            username_text = username_element.get_text(strip=True)
            username = re.search(r'@(\w+)', username_text)
            if username:
                tweet_data['username'] = username.group(1)

        # Extraire la date/heure
        time_element = element.find('time') or element.find(attrs={'data-testid': 'timestamp'})
        if time_element:
            tweet_data['timestamp'] = time_element.get('datetime', time_element.get_text(strip=True))

        # Extraire les métriques (likes, retweets, réponses)
        metrics = {
            'likes': ['favorite', 'like'],
            'retweets': ['retweet'],
            'replies': ['reply']
        }

        for metric, patterns in metrics.items():
            for pattern in patterns:
                metric_element = element.find(attrs={'data-testid': pattern}) or element.find(
                    class_=re.compile(pattern))
                if metric_element:
                    count_text = metric_element.get_text(strip=True)
                    count = re.search(r'\d+', count_text)
                    if count:
                        tweet_data[metric] = int(count.group())

        # Extraire les hashtags
        if tweet_data['content']:
            tweet_data['hashtags'] = re.findall(r'#(\w+)', tweet_data['content'])

        # Extraire les mentions
        if tweet_data['content']:
            tweet_data['mentions'] = re.findall(r'@(\w+)', tweet_data['content'])

        # Extraire les URLs
        url_elements = element.find_all('a', href=True)
        for url_element in url_elements:
            href = url_element.get('href')
            if href and href.startswith(('http://', 'https://')) and not href.startswith('https://twitter.com/'):
                tweet_data['urls'].append(href)

        # Extraire les images
        img_elements = element.find_all('img')
        for img in img_elements:
            if 'profile' not in img.get('alt', '').lower() and 'avatar' not in img.get('alt', '').lower():
                src = img.get('src')
                if src:
                    tweet_data['images'].append(src)

        # Extraire les vidéos
        video_elements = element.find_all(['video', 'div'], class_=re.compile('video|media'))
        for video in video_elements:
            src = video.get('src')
            if src:
                tweet_data['videos'].append(src)

        return tweet_data

    def to_json(self, tweets):
        """Convertit les tweets extraits en format JSON"""
        return json.dumps(tweets, ensure_ascii=False, indent=2)


# Exemple d'utilisation
def parse_twitter_html(html_content):
    parser = TwitterHTMLParser()
    tweets = parser.parse_html(html_content).extract_tweets()
    return tweets


